import React, { useState } from "react";
// import { IoClose, IoMenu } from "react-icons/io5";
import "./Navbar.css";

const Navbar = () => {
    return(
        <header>
            <div className="nav-area">
                <a href="/" className="logo">
                    Logo
                </a>
                <nav className="desktop-nav">
                    <ul className="menus">Nav Items here</ul>
                </nav>
            </div>
        </header>
    );
}

export default Navbar;
